rmal;\">Description </p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Netapp Storage Administration</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Who Should Attend? </p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">Network Professionals seeking the\r\nNetApp Certified Data Management Administrator (NCDA) Certification.  This course is also valuable for those who\r\nneed to perform in-depth support, administrative functions, and performance\r\nmanagement  for environments using any of\r\nthe following enterprise storage solutions: CIFS, NFS, FCP, iSCSI protocols on\r\na NetApp storage appliance  running the\r\nData ONTAP operating system </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Course Duration </p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">6 Days</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Course Contents </p>\r\n\r\n<p class=\"MsoNormal\" style=\"line-height: normal;\">This 6-day course will prepare you\r\nto pass NetApp exam (153) required to achieve the NetApp  Certified Data Management Administrator (NCDA)\r\ncertification.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Data ONTAP Fundamentals (DOTF)</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Data ONTAP CIFS Administration (CIFS)</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Data ONTAP NFS Administration (NFS)</li><li class=\"MsoNormal\" style=\"line-height: normal;\">NetApp Protection Software Administration (NPSA)</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Data ONTAP SAN Administration (SAN)</li><li class=\"MsoNormal\" style=\"line-height: normal;\">High Availability (HA)</li></ul>\r\n\r\n<p class=\"MsoNormal\"> </p>\r\n\r\n<ul class=\"bulletLeft\"></ul>','contact@ahana.co.in',249,'Hanumanth nagar','Ahana Systems & Solutions (P) Ltd.','0000','122.174.78.68','2011-02-12 12:45:07','1jzp0tmr',0,'26675891',1),(311,0,1,186,0,'Oracle 10g Database Administration Onsite Training.26-2-2011.','\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">Oracle 10g Database Administration -\r\nI ` Basic Database Administration </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Overview of Administering an Oracle Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Types of Oracle Database Users</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Tasks of a Database Administration</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Database Architecture</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Oracle Architecture </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Oracle Logical Storage Structures</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Oracle Logical Database Structures</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Oracle Physical Storage Structures</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Multiplexing Database Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Oracle Memory Structures</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Creating an Oracle Database </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Deciding How to Create an Oracle Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Manually Creating an Oracle Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Understanding the CREATE DATABASE Statement</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Understanding Initialization Parameters</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Troubleshooting Database Creation</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Dropping a Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing Initialization Parameters Using a Server\r\n     Parameter file</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Starting Up and Shutting Down </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Starting Up a Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Altering Database Availability</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Shutting Down a Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Quiescing a Database</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Suspending and Resuming a Database</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Managing Oracle Database Processes </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">About Dedicated and Shared Server Processes</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Configuring Oracle Database for Shared Server</li><li class=\"MsoNormal\" style=\"line-height: normal;\">About Oracle Database Background Processes</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Managing Control Files </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Guidelines for Control Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Control Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Troubleshooting After Creating Control Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Backing Up Control Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Recovering a Control File Using a Current Copy</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Dropping Control Files</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> Managing the Redo Log </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Basic working of Redo Log</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Planning the Redo Log</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Redo Log Groups and Members</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Relocating and Renaming Redo Log Members</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Dropping Redo Log Groups and Members</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing Archived Redo Logs </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">What Is the Archived Redo Log?</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Choosing Between NOARCHIVELOG and ARCHIVELOG Mode</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Controlling Archiving</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Specifying the Archive Destination</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Specifying the Mode of Log Transmission</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing Archive Destination Failure</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing Tablespaces </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Guidelines for Managing Tablespaces</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Tablespaces</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Altering Tablespace Availability</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Using Read-Only Tablespaces</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Renaming Tablespaces</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Dropping Tablespaces</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing the SYSAUX Tablespace</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Viewing Tablespace Information</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing Datafiles and Tempfiles </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Guidelines for Managing Datafiles</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Datafiles and Adding Datafiles to a Tablespace</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Changing Datafile Size</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Altering Datafile availability</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Renaming and Relocating Datafiles</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Dropping Datafiles</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Copying Files using the Database Server</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing the Undo Tablespace </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">What Is Undo?</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Introduction to Automatic Undo Management</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Setting the Undo Retention Period</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Sizing the Undo Tablespace</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing Undo Tablespaces</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Using\r\nOracle-Managed Files </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">What Are Oracle-Managed Files?</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Enabling the Creation and Use of Oracle-Managed Files</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Oracle-Managed Files</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: right; line-height: normal;\" align=\"right\"><a rel=\"nofollow\" href=\"http://training.ahana.co.in/oracle-10g-DBA.php#top\">Top </a></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">   <a name=\"10gAdminII\"></a>Oracle 10g Database\r\nAdministration - II Using Automatic Storage Management </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">What Is Automatic Storage Management?</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Overview of the Components of Automatic Storage\r\n     Management</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Administering an Automatic Storage Management Instance</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Administering Automatic Storage Management Disk Groups</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Using Automatic Storage Management in the Database</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing Schema Objects </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Creating Multiple Tables and views in a Single\r\n     Operation</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Analyzing Tables, Indexes and Clusters</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Truncating Tables and Clusters</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Renaming Schema Objects</li></ul>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\">  Managing Space for Schema Objects </p>\r\n\r\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing Space in Data Blocks</li><li class=\"MsoNormal\" style=\"line-height: normal;\">Managing Storage Parameters</li><li class=\"MsoNormal\" style=\"line-height: normal;