ndhra Pradesh, India','Khan','','122.174.93.103','2011-02-15 12:56:46','afr6twnx',0,'9866141982',1),(426,1,1,160,0,'Ad posting Jobs, Part time jobs , Online Jobs , Home based jobs ','<div class=\"style8\" style=\"font-family: Verdana,Arial,Helvetica,sans-serif; font-size: 12px; padding-left: 5px;\" align=\"left\">Ad posting is basically Form filling work. You need to enter data into forms, you hit submit, and there you go, your ad is placed. It\'s that simple. You can earn up to Rs.2 per adposting. Ad Posting is big business on the internet. As the larger companies don\'t have time to place ads all the time so they outsource the work to home based workers. For more details please visit http://thenetjobs.in/</div>[youtube=http://www.youtube.com/watch?v=XXXXXXX]','snehasisdas.99@gmail.com',247,'India','snehasis das','1000','122.174.93.103','2011-02-15 13:27:54','3yh1al5p',0,'03228250986',0),(428,1,1,186,0,'MORF INDIA WINS UNESCO - WATER DIGEST AWARD FOR THE SECOND SUCCESSIVE YEAR','\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left: 39pt; text-indent: -0.25in; line-height: normal;\">· Award for outstanding domestic water treatment project\r\nexecutions and contribution in the field of water in India</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><b>Chennai:\r\nFeb 1, 2011</b>: MORF INDIA LIMITED, an ISO\r\ncertified and CRISIL rated public limited company has once again won the <b>UNESCO\r\nWater Digest Award for the year 2010-11.</b> UNESCO Water Digest Award has been\r\nawarded this time to MORF for distinguished domestic project executions and for\r\nthe outstanding contribution in the field of water in India.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><b>Mr.K.\r\nSukumar, Head-Corporate Strategy</b>,\r\nMORF INDIA said “UNESCO-Water Digest award a second time has only reinforced\r\nour position as a formidable player in the water treatment industry. This award\r\nfor distinguished domestic project executions will help us further bolster our\r\ndominant market share in the builder-architect-institutions segment. Last year\r\nwe won this award for being the distinguished complete domestic water solutions\r\nprovider. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">He\r\nfurther stated that “We are one of the very few companies to provide end-to-end\r\nsolutions in water purification and sewage treatment in India. This year we\r\nhave launched our revolutionary business format <b>MTBN. </b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\"><b>MTBN\r\n</b>which stands for <b>Multi-Tier\r\nBusiness Network </b>is a breakthrough business model which would help us scale\r\nup our reach and volumes exponentially within a relatively shorter time frame”.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">Each\r\ntier in this <b>MTBN</b> will have a complementary role to play. This network\r\nwill be established in the Tier I cities of South India before the end of this\r\nyear. Tier II and Tier III cities across South India will be covered by 2012.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">This\r\n<b>MTBN, </b>once consolidated, will be a marketing juggeaut reaching our\r\nproducts to the nook and coer of South India. A blitzkrieg advertisement\r\ncampaign as part of our brand-building exercise is in the offing and should\r\ncommence by June 2011.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">By\r\nthe end of this year, we are planning to launch cutting-edge consumer products\r\nin the solar and air purification segments. Our goal is to transform MORF INDIA\r\ninto a preeminent national player in the <b>environment and health segment by\r\n2013.</b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">Mr.Sukumar\r\nhas also announced that they are already in talks with a few VC funds for\r\nequity funding. This exercise is expected to be completed by April 2011.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: normal;\"> </p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal;\">For\r\ndetails: <b>K. Sukumar: </b>Head - Corporate Strategy H/P: 98412 05836, <a rel=\"nofollow\" href=\"mailto:corp.strategy@morfindia.com\">corp.strategy@morfindia.com</a>\r\n</p>\r\n\r\n<p class=\"MsoNormal\"> </p>\r\n\r\n','tenzai05sunitha@gmail.com',251,'India','tenzai2205','0.00','122.174.93.103','2011-02-15 14:59:51','agk52s48',0,'9941266666',1),(429,1,1,160,0,'Work at home / Part time job / Home based job ','\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 3pt; line-height: normal;\">Ea up to Rs. 25,000 per month through simple online SMS\r\nSENDING JOB. Inteet brings to you an excellent home based business, Opportunity\r\nto ea online with your convenient timings from home, Office or cyber cafe.\r\nGenuine online SMS MARKETING JOBS for all. Only, basic knowledge of computer\r\nand inteet experience required. Anyone can do this work like housewives,\r\nretired, students and working persons. For more details please mail us at