harge controller and other things5. 3mts wire for first luminary, 10mts mts wire for second luminary6. 60LED / 120LED high bright luminary strip with proper housing and reflector7. Nuts and bolts to fix panels8. Instructions leafletIn low mode you can get about 200 Lumen of light, in which people can read and write and ladies can do their common household jobs. These are the best modules for all homes, offices, shops, industries, community centers, village Panchayat, mobile canvassing, emergencies, public addressing etc.Since most governmental agencies private cannot supply power to almost all the areas of requirement, these solar products find very advantageous especially in mobility. In time of power cut or load shedding these cater to emergencies of all sorts. All these products are directly available for people living at Vijayawada, eluru, denduluru, bhimadole, tadepalligudem, nidadavole, kovvur, godavari, rajahmundry, samalkot, kakinada, pithapuram, tuni, annavaram, anakapalli, tadi, duvvada, vizag, visakhapatam, vizianagaram, salur, srikakulam, madhira, khammam, dornakal, mahaboobabad, warangal, kazipet, bibinagar, ghatkeskar, Guntur, Tenali, Nellore, Ongole, bapatla, chirala, ongole, singarayakonda, bitragunta, kavali, nellore, gudur, renigunta, srikalahasti, tirupathy, Cuddapah, Kurnool, Anantapur, guntakal, bhimavaram, nuzvid, because Vijayawada is centrally located to all these stations and Vijayawada is the commercial capital of Andhra Pradesh.Even in big cities like agartala, agra, ahmedabad, ajmere, aligarh, Allahabad, alleppy, alwal, ambala, amritsar, Andaman, Chennai, ankleswar, arokkanam, asansol, bhavanagar, bhilai, durg, bhiwandi, Bhopal, bhuj, bhubaneswar, bidar, bihar, bijapur, bikaneer, bhilaspur, bokaro, calicut, chandigarh, kerala, Chidambaram, dindigul, durgapur, dwaraka, ernakulam, erode, faizabad, faridabad, fatepur, sikhri, ferozpur, gandhinagar, gangotri, gangtok, guwahati, gaya, Ghaziabad, gorakpur, gulbarga, gulmarg, gurgaon, gwalior, h